import React from 'react';

class Layout extends React.Component{

    render(){
        return(
            <React.Fragment>
                <header className="header"></header>
                <main className="main"></main>
                <footer className="footer"></footer>
            </React.Fragment>
        )
    }

}
export default Layout;
